import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { fetchOrders, createOrder, updateOrder, deleteOrder, fetchNextOrderId } from '../services/api';

const OrdersPage = () => {
  const [orders, setOrders] = useState([]);
  const [nextOrderId, setNextOrderId] = useState('');
  const [newOrder, setNewOrder] = useState({ creator: '', responsible: '', company: '' });
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);

  const navigate = useNavigate();

  useEffect(() => {
    const loadOrders = async () => {
      try {
        const data = await fetchOrders();
        setOrders(data);
      } catch (err) {
        setError('Failed to fetch orders.');
      }
    };

    const loadNextOrderId = async () => {
      try {
        const id = await fetchNextOrderId();
        setNextOrderId(id);
      } catch (err) {
        setError('Failed to fetch next order ID.');
      }
    };

    loadOrders();
    loadNextOrderId();
  }, []);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewOrder((prev) => ({ ...prev, [name]: value }));
  };

  const handleCreateOrder = async () => {
    setLoading(true);
    try {
      const createdOrder = await createOrder(newOrder);
      setOrders((prev) => [...prev, createdOrder]);
      navigate(`/orders/${createdOrder.orderId}`);
    } catch (err) {
      setError('Failed to create order.');
    } finally {
      setLoading(false);
    }
  };

  const handleDeleteOrder = async (orderId) => {
    try {
      await deleteOrder(orderId);
      setOrders((prev) => prev.filter((order) => order.orderId !== orderId));
    } catch (err) {
      setError('Failed to delete order.');
    }
  };

  const handleUpdateOrder = async (orderId) => {
    const updates = prompt('Enter updated fields in JSON format (e.g., {"creator": "New Creator"})');
    if (updates) {
      try {
        const updatedOrder = await updateOrder(orderId, JSON.parse(updates));
        setOrders((prev) =>
          prev.map((order) => (order.orderId === orderId ? updatedOrder : order))
        );
      } catch (err) {
        setError('Failed to update order.');
      }
    }
  };

  return (
    <div>
      <h1>Orders</h1>
      {error && <p style={{ color: 'red' }}>{error}</p>}
      <table border="1" style={{ width: '100%', textAlign: 'left', marginBottom: '20px' }}>
        <thead>
          <tr>
            <th>Order ID</th>
            <th>Creator</th>
            <th>Responsible</th>
            <th>Company</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {orders.map((order) => (
            <tr key={order.orderId}>
              <td>{order.orderId}</td>
              <td>{order.creator}</td>
              <td>{order.responsible}</td>
              <td>{order.company}</td>
              <td>
                <button onClick={() => navigate(`/orders/${order.orderId}`)}>View</button>
                <button onClick={() => handleUpdateOrder(order.orderId)}>Edit</button>
                <button onClick={() => handleDeleteOrder(order.orderId)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      <h2>Create Order</h2>
      <form
        onSubmit={(e) => {
          e.preventDefault();
          handleCreateOrder();
        }}
      >
        <div>
          <label htmlFor="orderId">Next Order ID:</label>
          <input type="text" id="orderId" value={nextOrderId} readOnly />
        </div>
        <input
          type="text"
          name="creator"
          placeholder="Creator"
          value={newOrder.creator}
          onChange={handleInputChange}
          required
        />
        <input
          type="text"
          name="responsible"
          placeholder="Responsible"
          value={newOrder.responsible}
          onChange={handleInputChange}
          required
        />
        <input
          type="text"
          name="company"
          placeholder="Company"
          value={newOrder.company}
          onChange={handleInputChange}
          required
        />
        <button type="submit" disabled={loading}>
          {loading ? 'Creating...' : 'Create Order'}
        </button>
      </form>
    </div>
  );
};

export default OrdersPage;
